import { makeStyles } from '@material-ui/core'
import abstractImage from '../../images/Abstract-Envelope.svg'


export default makeStyles((theme) => ({
    root: {
        width: '70vw',
        maxHeight: '90vw',
        display: 'flex',
        flexDirection: 'row',
        alignItems:'center',
        justifyContent:'center',
        [theme.breakpoints.down('xs')]: {
            width: '100vw',

        }
    },
    homeDisplay: {
        display: 'flex',
        flexDirecton: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    },
    imageDisplay: {
        width: 180,
        height: 180,
        borderRadius: 20,
        zIndex: 0,
        [theme.breakpoints.down('sm')]: {
            //marginTop: 30,
            width: 300,
            height: 300,
        },
        [theme.breakpoints.down('xs')]: {
            //marginTop: 30,
            width: 100,
            height: 100,
        },
    },
}))
